import React, { useEffect, useState } from "react";
import api from "../api/axios";
import { Link } from "react-router-dom";
import "./AyurvedaStore.css";

export default function AyurvedaStor() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchAyurvedicProducts = async () => {
      try {
        const res = await api.get("/medicines/category", {
          params: { type: "ayurveda" },
        });
        setProducts(res.data || []);
      } catch (err) {
        console.error("‚ùå Error fetching Ayurveda products:", err.message);
        setProducts([]);
      } finally {
        setLoading(false);
      }
    };

    fetchAyurvedicProducts();
  }, []);

  return (
    <div className="ayurveda-store">
      {/* üåø Banner */}
      <div className="banner">
        <h1>MediQ Ayurvedic Store</h1>
        <p>Rooted in Kerala‚Äôs healing traditions</p>
      </div>

      {/* üß™ Top Ayurvedic Treasures */}
      <section className="section">
        <h2>Top Ayurvedic Treasures</h2>
        <div className="product-grid">
          {products.slice(0, 6).map((item) => (
            <div key={item._id} className="product-card">
              <img src={item.image} alt={item.name} />
              <h5>{item.name}</h5>
              <p>‚Çπ{item.price}</p>
              <button className="btn btn-success">Add</button>
            </div>
          ))}
        </div>
      </section>

      {/* üßò‚Äç‚ôÄÔ∏è Specialty Picks */}
      <section className="section specialty">
        <h2>Specialty Ayurvedic Picks</h2>
        <div className="product-grid">
          {products.slice(6, 12).map((item) => (
            <div key={item._id} className="product-card">
              <img src={item.image} alt={item.name} />
              <h5>{item.name}</h5>
              <p>‚Çπ{item.price}</p>
              <button className="btn btn-outline-success">Add</button>
            </div>
          ))}
        </div>
      </section>

      {/* ü•§ Juices for Wellness */}
      <section className="section juices">
        <h2>Juices for Wellness</h2>
        <div className="product-grid">
          {products.filter(p => p.name.toLowerCase().includes("juice")).map((item) => (
            <div key={item._id} className="product-card">
              <img src={item.image} alt={item.name} />
              <h5>{item.name}</h5>
              <p>‚Çπ{item.price}</p>
              <button className="btn btn-outline-success">Add</button>
            </div>
          ))}
        </div>
      </section>

      {/* üß≠ Shop by Category */}
      <section className="section categories">
        <h2>Shop by Category</h2>
        <div className="category-grid">
          {["Ayurveda", "Homeopathy", "Unani", "Siddha"].map((cat) => (
            <div key={cat} className="category-tile">
              <img src={`/assets/${cat.toLowerCase()}.png`} alt={cat} />
              <h5>{cat}</h5>
            </div>
          ))}
        </div>
      </section>

      {/* üìö Blog Previews */}
      <section className="section blog">
        <h2>Ayurvedic Home Remedies</h2>
        <div className="blog-grid">
          {["Amla Benefits", "Stress Relief", "Herbal Cleansing", "Skin Tips"].map((title, idx) => (
            <div key={idx} className="blog-card">
              <img src={`/assets/blog${idx + 1}.jpg`} alt={title} />
              <h5>{title}</h5>
              <p>Explore traditional remedies and wellness tips.</p>
              <Link to="/blog" className="btn btn-sm btn-outline-success">Read More</Link>
            </div>
          ))}
        </div>
      </section>

      {/* ü¶∂ Footer */}
      <footer className="footer mt-5">
        <div className="footer-links">
          <div>
            <h6>Company</h6>
            <p>About MediQ</p>
            <p>Pharmacists</p>
            <p>Certificates</p>
          </div>
          <div>
            <h6>Policies</h6>
            <p>Terms & Conditions</p>
            <p>Privacy Policy</p>
            <p>Refund Policy</p>
          </div>
          <div>
            <h6>Connect</h6>
            <p>Facebook</p>
            <p>Instagram</p>
            <p>LinkedIn</p>
          </div>
        </div>
        <p className="text-center mt-3">¬© MediQ 2025 MediQ Marketplace Ltd.</p>
      </footer>
    </div>
  );
}
